INSERT INTO `rooms` VALUES (1,'2021-09-18 17:04:52.572000',1,'2021-09-18 17:04:52.572000',2,1,2,1,'GOSHOBO is the oldest ryokan hotel in Arima Onsen, one of the three historical hot springs in Japan. It has served people since its foundation in the 12th century.\n\nThe guest room is a nostalgic tatami room with two beds, with a modern updated toilet attached. You can view a serene Zen garden and the refreshing Mt. Rokko.\n\nThe public hot spring bath in the hotel is open from 3 pm to 9:30 am.',11.0341,106.688,'A Relaxing Stay at a Historical Hot Spring Ryokan Hotel in Arima(a twin room, up to two people)歴史的木造建築の旅館,景観は庭のツイン【2名定員】',364,'PER_NIGHT',0,6,8893,1,1,29,2,3,'1',2,' 92 đường Man Thiện - P.Tăng Nhơn Phú A - Q9'),(4,'2021-11-20 13:36:05.022000',1,'2021-12-02 20:01:10.585000',3,3,3,3,'Vị trí trung tâm,Phù hợp cho gia đình',11.0341,106.688,'Stunning wooden stilted house near Ban Dam Museum',645000,'PER_NIGHT',0,1,8893,216,2,29,2,3,'Capture - Copy.PNG',2,' 92 đường Man Thiện - P.Tăng Nhơn Phú A - Q9'),(1528,'2021-12-08 19:15:31.227000',1,'2021-12-08 19:15:31.227000',9,6,9,10,'#1\'FQFf\'09',10.8479,106.785,'Mrs. Bradford Kunze',8163730,'PER_NIGHT',0,12,9081,216,2,29,137,1,'75abe841-5251-4979-9bf1-3e8c26a77e8d.jpg',2,'Học Viện Công Nghệ Bưu Chính Viễn Thông, 92 đường Man Thiện - P.Tăng Nhơn Phú A - Q9'),(1529,'2021-12-08 19:17:37.550000',1,'2021-12-08 19:17:37.550000',4,8,6,7,'Carbonite web goalkeeper gloves are ergonomically designed to give easy fit',10.8479,106.785,'Howard Thiel',1125340,'PER_NIGHT',0,5,9081,216,2,29,137,1,'a8fc658b-382a-418f-9ea6-8092bdd98126.jpg',3,'Học Viện Công Nghệ Bưu Chính Viễn Thông, 92 đường Man Thiện - P.Tăng Nhơn Phú A - Q9'),(1530,'2021-12-08 19:18:03.169000',1,'2021-12-09 09:00:06.454000',3,2,4,4,'New ABC 13 9370, 13.3, 5th Gen CoreA5-8250U, 8GB RAM, 256GB SSD, power UHD Graphics, OS 10 Home, OS Office A & J 2016',10.8479,106.785,'Guy Fisher Man',605650,'PER_NIGHT',0,4,9077,216,2,29,134,4,'a8fc658b-382a-418f-9ea6-8092bd